jQuery(document).ready(function(){jQuery('.sticky-panel.images-settings-panel .button-tooltip button').click(function(event){var submitButton=jQuery('.sticky-panel.images-settings-panel button.submit').get(0),proceed=true;if(!jQuery(submitButton).prop('disabled'))proceed=confirm(core.t('There are unsaved changes on the page. If you choose to continue, these changes will be lost. Do you want to proceed?'));if(proceed){self.location=jQuery(this).data('url')}else event.stopImmediatePropagation()})})